// src/components/ArtistSpotlightCard.js
import React from 'react';
import './ArtistSpotlightCard.css';

const ArtistSpotlightCard = () => {
  return (
    <div className="artist-card">
      <h3>Artist Spotlight: Freddie Mercury</h3>
      <p><strong>Genre:</strong> Rock</p>
      <p><strong>Known For:</strong> Lead vocalist of Queen, famous for songs like "Bohemian Rhapsody"...</p>
      <p><strong>Influence:</strong> Freddie's flamboyant style and exceptional vocal range have inspired generations...</p>
    </div>
  );
};

export default ArtistSpotlightCard;
